import React from "react";
import NavBarItem from "./NavBarItem";

const NavBar = (props) => {
  const data = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];

  return (
    <ul>
      {data.map((item) => {
        return (
          <NavBarItem style={`list-style:${item.icon}`}>{item.type}</NavBarItem>
        );
      })}
    </ul>
  );
};

export default NavBar;
